  return (
    <div className="text-center m-2">
      <button
        className="btn btn-danger"
        onClick={() => setCounter(counter - 1)}
      >
        -
      </button>
      <span className="text-white mx-2">{props.productPrice}â‚º</span>
      <button
        className="btn btn-danger"
        onClick={() => setCounter(counter + 1)}
      >
        +
      </button>
    </div>
  );
}

export default Counter;
